if(!configuration['username'] ||
   !configuration['navision.company.name'] || 
   !configuration['password']) {
  done({
    response_body: "Missing configuration(s). Company Name, Username, & Password are required.", 
    continue: false})
}

let requestHeaders = {
  Authorization: `Basic ${CE.b64(configuration['username'] + ':' + configuration['password'])}`
};

done({
  request_vendor_headers: requestHeaders
});

const standardEndPoints = {
    'companies': 'Company Details',
    'contacts': 'Contact Card',
    'customers': 'Customer Card',
    'items': 'Item Card',
    'salesOrders': 'Sales Order',
    'sales-orders': 'Sales Order',
    'invoices': 'Sales Invoice'
};
var serviceName;
var pathVariable;
var objectName;
let new_request_vendor_path = request_vendor_path;
let new_vendor_headers = request_vendor_headers;
let navisionServiceConfig = JSON.parse(configuration['navision.service.configuration']);

function addMatchIfHeaderIfPatch() {
    //For patch If-Match header is required
    if (request_vendor_method.toLowerCase() === 'patch') {
        new_vendor_headers['If-Match'] = '*';
    }
}

function checkAndReplaceSpaceWithUnderScore(objectName) {
    return objectName.split(' ').join('_');
}

function constructPathVariables(serviceConfigRecord) {
    var pathVariable = '';
    if (request_path_variables && request_path_variables['objectId']) {
        if (serviceConfigRecord && serviceConfigRecord.documentType) {
            pathVariable = "(Document_Type='" + serviceConfigRecord.documentType + "',No='" + request_path_variables['objectId'] + "')";
        } else {
            pathVariable = "('" + request_path_variables['id'] + "')";
        }
    }
    return pathVariable;
}

addMatchIfHeaderIfPatch();
const resourceName = object_name;
if (standardEndPoints[resourceName]) {
    objectName = standardEndPoints[resourceName];
} else {
    objectName = resourceName;
}

for (var i = 0; i < navisionServiceConfig.length; i++) {
    var record = navisionServiceConfig[i];
    if (record.objectName && record.objectName === objectName) {
        serviceName = checkAndReplaceSpaceWithUnderScore(record.serviceName);
        pathVariable = constructPathVariables(record);
        break;
    }
}
if (!serviceName) {
    serviceName = objectName;
    pathVariable = constructPathVariables();
}
if(request_vendor_path){
  new_request_vendor_path = new_request_vendor_path.replace('{service_name}', serviceName);
  if(pathVariable){
      new_request_vendor_path = new_request_vendor_path.replace('{service_parameters}', pathVariable);
  }
}
done({
    request_vendor_path: new_request_vendor_path,
    request_vendor_headers: new_vendor_headers
});
